import React, {Component} from 'react';
import {Elements, StripeProvider} from 'react-stripe-elements';
import CheckoutForm from './components/pago';

class App extends Component {
  render() {
    return (
      <StripeProvider apiKey="pk_test_iPx2vuJTVvX4uEuSp5Btp07A00R35iKp8i">
        <div className="example">
          <h1>React Stripe Elements Example</h1>
          <Elements>
            <CheckoutForm />
          </Elements>
        </div>
      </StripeProvider>
    );
  }
}

export default App;
